sys_variable_value.value:
(function execute(inputs, outputs) {
  var cfy_integration = new cloudify_integration();
	// convert inputs array object to dict
  var dep_inputs = {};
  for (var i = 0; i < inputs.dep_inputs.length; i++) {
    var variable = inputs.dep_inputs[i];
    if (variable.input_name!='' && variable.input_value!= ''){
      switch(variable.input_type){
        case 'integer':
          dep_inputs[variable.input_name] = parseInt(variable.input_value);
          break;
        case 'float':
          dep_inputs[variable.input_name] = parseFloat(variable.input_value);
          break;
        case 'boolean':
          dep_inputs[variable.input_name] = variable.input_value.toLowerCase()==='true';
          break;
        case 'list':
          var arrayVal = [];
          var jsonVal = JSON.parse(variable.input_value);
          for( var j = 0 ;j< jsonVal.length;j++)
            arrayVal.push(jsonVal[j]);
          dep_inputs[variable.input_name] = arrayVal;
          break;
        case 'dict':
          dep_inputs[variable.input_name] = JSON.parse(variable.input_value);
          break;
        default:
          dep_inputs[variable.input_name] = variable.input_value;
          break;
      }
    }
  }
  // convert labels array object to array of dicts
  var dep_labels = [];
  for (var i = 0; i < inputs.dep_labels.length; i++) {
    var label = inputs.dep_labels[i];
    if (label.label_name!='' && label.label_value!= ''){
      var dep_label = {}
      dep_label[label.label_name] = label.label_value;
      dep_labels.push(dep_label);
    }
  }
  dep_labels.push({'created_from':'servicenow'});
  var creator_email = inputs.creator_email;
  // remove @ from the email and replace it with -at-
  var lastIndex = creator_email.lastIndexOf('@');
  creator_email = creator_email.substring(0, lastIndex) + '-at-' + creator_email.substring(lastIndex + 1);

  //dep_labels.push({'csys-external-user':creator_email});
  dep_labels.push({'created_by':creator_email});

  outputs.result = cfy_integration.createDeployment(inputs.blueprint_id,inputs.deployment_id,dep_inputs,inputs.site_name, dep_labels, inputs.private_resource, inputs.skip_plugins_validation, inputs.visibility);

})(inputs, outputs);

